window.bookSummaryJSON = "<p><b>Alexa has come a long way in her journey to awakening as a super while also getting caught in all of the political intrigue that follows.</b></p> <p>Immediately, Alexa finds herself drawn into the evil plans of a mad Countess who, at one point, turned her back on her own daughter, only to return now with a vengeance. Alexa is forced to choose between saving the life of her brother and rupturing the family bonds of her now-best friend.</p> <p>From there, things grow only worse. Dragons are breaking free into the world. Wherever a dragon appears, only death awaits. Recruited to assist in a worldwide effort to eradicate dragons, Alexa soon finds herself facing danger and betrayal from the otherworldly protectors who are now showing themselves to the public in an attempt to garner public respect and support before the final integration occurs.</p> <p>Danger lurks around every shadow as Alexa must carve out a name for herself and others in this new world that she now finds herself in.</p>"; 
